export class Employee {
    constructor(id, name, role, daily_rate, status, cpf, pix_key, company_id, created_at, updated_at) {
        this.id = id;
        this.name = name;
        this.role = role;
        this.daily_rate = daily_rate;
        this.status = status;
        this.cpf = cpf;
        this.pix_key = pix_key;
        this.company_id = company_id;
        this.created_at = created_at;
        this.updated_at = updated_at;
    }
}
